import React, { useEffect, useState } from 'react'
import { Link, useLocation } from 'react-router-dom'
import "../styles/Navbar.css"
import { Reorder } from '@mui/icons-material'

function Navbar() {
	const [expandNavbar, setExpandNavbar] = useState(false);
	const [stylehome, setStylehome] = useState();
	const [styleproject, setStyleproject] = useState();

	const location = useLocation();

	useEffect(() => {
		setExpandNavbar(false);
	}, [location]);

	function isCurrentHome() {
		console.log(location.pathname)
		if (location.pathname === 'localhost:3000')
			setStylehome("underlinedTitle")
		else
			setStylehome("noneTitle")
	}

	function isCurrentProject() {
		console.log(location.pathname)
		if (location.pathname === 'localhost:3000/Projects')
			setStyleproject("underlinedTitle")
		else
			setStyleproject("noneTitle")
	}

	const styleUnderline = {
		textDecoration: 'underline',
	};

	return (
		<div className="navbar" id={expandNavbar ? "open" : "close"}>
			<div className="toggleButton">
				<button
					onClick={() => {
						setExpandNavbar((prev) => !prev);
					}}
				>
					<Reorder />
				</button>
			</div>
			<div className="links">
				<Link className={stylehome} to="/"> Home </Link>
				<Link className={styleproject} to="/Projects"> Projects </Link>
			</div>
		</div>
	);
}

export default Navbar
